export const imp = () => {
    return  {
        type: 'IMP',
        payload: (state) => {
            const count = !state;
            state ? { color: red } : { color: black }
        }
    }
}

export const inc = () => ({type: 'INC'});

export const dec = () => ({type: 'DEC'});
